// WorkoutSummary.tsx
import React from 'react';
import { Container, Typography, Button } from '@mui/material';
import { useNavigate } from 'react-router-dom';

interface Workout {
  name: string;
  reps: number;
  sets: number;
  weight: number; // Add the weight property
}

interface WorkoutSummaryProps {
  workouts: Workout[];
}

const WorkoutSummary: React.FC<WorkoutSummaryProps> = ({ workouts }) => {
  const navigate = useNavigate();

  const handleGoBack = () => {
    // Navigate back to the WorkoutPlan page
    navigate('/workout-plan');
  };

  return (
    <Container maxWidth="md" sx={{ textAlign: 'center', mt: 3 }}>
      <Typography variant="h4" color="primary" gutterBottom>
        Workout Summary
      </Typography>

      {/* Display summary for each workout */}
      {workouts.map((workout, index) => (
        <div key={workout.name} style={{ marginBottom: '16px' }}>
          <Typography variant="h6" color="primary">
            Workout {index + 1} - {workout.name}
          </Typography>
          <Typography variant="body1" color="white">
            Reps: {workout.reps} | Sets: {workout.sets} | Weight: {workout.weight}
          </Typography>
          {/* Add any additional information you want to display */}
        </div>
      ))}

      <Button variant="contained" size="large" color="primary" onClick={handleGoBack}>
        Go Back to Workout Plan
      </Button>
    </Container>
  );
};

export default WorkoutSummary;
